import { Link } from 'react-router-dom';


function TavernPublish() {


function getParameters() {
        let urlString = 
"http://localhost:3000/tavern/%7D[object%20Object]";
        let paramString = urlString.split('?')[1];
        let queryString = new URLSearchParams(paramString);
        for(let pair of queryString.entries()) {
            console.log("Key is:" + pair[0]);
            console.log("Value is:" + pair[1]);
        }
    }


    getParameters();


    const items = JSON.parse(window.localStorage.getItem('TavernItems'));
    console.log(items);



    return (
        <div >
            <h1 className='title'>Tavern</h1>
            <div className='itemsContainer'>

                    {items.map(item => (
                        <div key={item.id} className="items">
                            <span>
                                <h1><Link className='itemNames' to={`/tavern${item.url}`}>{item.value}</Link> </h1>
                                <span key={item.id} className="itemCost">
                                    <span className="cost-published">{item.cost}</span>
                                    <span className="coinType=Published">{item.coinType}</span>
                                </span>
                            </span>
                        </div>
                ))}

            </div>
        </div>
    );
}




export default TavernPublish;
